import React, {useState, useEffect} from 'react';
import {View, TouchableOpacity, Text} from 'react-native';
import style from './style.js';

export default function Home({navigation, route}){
    const [lista, setLista] = useState([]);
    const {id , nome } = route.params;

    useEffect(() =>{
        let url = "http://10.87.207.20:8080/api/equipe";

        fetch(url)
        .then((response) =>{
            return response.json();
        }).then(data =>{
            setLista(data);
        })
    })

    return(
        <View>
            <View>
                <Text>Criar uma equipe nova:</Text>
                <TouchableOpacity onPress={() => {navigation.navigate("Criacao")}}>
                    <Text>CRIAR</Text>
                </TouchableOpacity>

            </View>
            <View>
                <Text>Ver equipes existentes: </Text>
                {
                    lista.map((item, index) =>{
                        return (
                            <TouchableOpacity key={index} onPress={() =>{navigation.navigate("Equipe", {id: item.id})}}>
                                <Text>{item.nomeEquipe}</Text>
                                <Text>{item.nomeCoach}</Text>
                            </TouchableOpacity>
                        )
                    })
                }
            </View>
        </View>
    )
}
